import '../constants/action-types'
import { SET_ACTIVE_RESERVATION, SET_USER_EMAIL, ADD_RESERVATION, EDIT_RESERVATION, SAVE_RESERVATION, GET_RESERVATIONS, SET_RESERVATIONS, SET_ROOMS, TOGGLE_ADD_MODAL, TOGGLE_EDIT_DELETE_MODAL, CHANGE_DATE, SET_USER_RESERVATIONS, DELETE_RESERVATION } from '../constants/action-types'

export function setActiveReservation(payload){
    return {
        type: SET_ACTIVE_RESERVATION,
        payload
    }
}
